import React from 'react';
import styled from "styled-components";

const Text = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 19px;
color: #444444;
`;

const PriceText = styled(Text)`
margin:auto;
`;

const Title = styled(Text)`
font-weight: bold;
padding-bottom:20px;

`;
const Container = styled("div")`
padding:15px;
`;


const Item = () => {
    return (
        <>
            <Container>
                <Title>What do you need?</Title>
            </Container>
        </>
    );
}

export default Item;
